import React, { Component } from 'react';

class Event extends Component {
    render() {
        return (
            <div className="event" >
                <img/>
                <div>
                    <h4>{this.props.title}</h4>
                    <ul className="musicstyles">
                        {this.props.musicstyles.map(ms => (
                        <li className="">{ms.style}</li>    
                        ))}
                    </ul>
                </div>
            </div>
        )
    }
}
export default Event
